import star from './images/icon-star.svg'

function App() {
  return (
    <div className="wrapper">
      <img className="bg-gray-600 p-1 rounded-full" src={star} alt='' />
      <h1 className="p-5 text-5">How did we do?</h1>
    </div>
  );
}

export default App;
